<div style=position:absolute;margin-top:-800px;padding:30px>
The Honourable K.G.Ummechan lead by just 13 householders begining in 1941 as a chappel for the prayer. The shed was made by bamboo, ada wood roof and grass-fed shed. The worship and sunday schools were held in that shed. Years later the dirt wall and old wooden roofs were replaced by bricks and stones with a new wooden roof.There we worshiped out for 10 years. The number of homes increased gradually. In 1995 the entire roof ws made of wood and the tile was laid.On 1995 July 17, a parishoner was formed from the chapel named <b>Mathra Immanuel Marthoma Church</b>. The Parish started by 13 householders now has 152 families. Over time, the parsonage, parish hall and pavilion were able to be built. God has given this beaautiful church to us on 2001. The dedication ceremony of the shrine was held on 22nd August 2001. 
